      <Nav />
      pages.find(page.name === "home").map(p=><div>This is {p.path}</div>
      <div>p.paragraph</div>
      <div> p.picture</div>)
    </div>
  );
}
HomePage.getInitialProps = async () => {
  const res = await fetch("http://localhost:1337/pages");
  const json = await res.json();
  return { pages: json };
};
export default HomePage;
